// 2nd way to do this with a for...of loop()

const CardList = function({ robots }) {
    const CL = [];
    for (let user of robots) 
        CL.push(<Card key={robots.indexOf(user)} id={user.id} name={user.name} email={user.email}/>)
    return (
        <div>
            {CL}
        </div>
    );
};

export default CardList;
